import logo from './logo.svg';
import './App.css';
import { Login } from './Login';
import { useState, useEffect } from 'react';
import React from 'react'


const App = () => {
  const [isLoggedin, setIsLoggedIn] = useState(false)

  if(isLoggedin) {
    return <div>
      todos
    </div>
  } else {
    return (
      <Login onLoggedIn={(authData => {
        setIsLoggedIn(true)
      })} />
    );
  }


}

export default App;
